import React from "react";
import wordle from "./wordle.png";
import './Welcome.css';

function WelcomeHard(props){
    return(
        <div className="layout">
            <div className="title">Wordle Game</div>
            <img src={wordle} alt="Logo" className="logo" />
            <div className="subtitle">Get 5 chances to guess a 7-letter word.</div>
            <button className="button_welcome">
                Play
            </button>
            <button className="button_welcome">
                Rule
            </button>
        </div>
    )
}

export default WelcomeHard;
